// define a function that removes consecutive triple characters from a string
function f_gold(s) {
    var ans = [];
    for (var c of s) {
        // check if the last two characters in the answer array are the same as the current character
        if (ans.length > 1 && ans[ans.length - 1] == ans[ans.length - 2] && ans[ans.length - 2] == c) {
            // if so, skip this character and move on to the next one
            continue;
        }
        // otherwise, add the character to the answer array
        ans.push(c);
    }
    // join the answer array into a string and return it
    return ans.join('');
}
